  "By using a loop node, you can perform the same operation on multiple sets of data. The source of these sets can be either multiple records from a query node or multiple associated records of a single record. Loop node can also be used for iterating a certain number of times or for looping through each character in a string. However, excessive looping may cause performance issues, so use with caution.": "Korzystaj\u0105c z w\u0119z\u0142a p\u0119tli, mo\u017Cesz wykona\u0107 t\u0119 sam\u0105 operacj\u0119 na wielu zestawach danych. \u0179r\xF3d\u0142em tych zestaw\xF3w mog\u0105 by\u0107 zar\xF3wno wiele rekord\xF3w z w\u0119z\u0142a zapytania, jak i wiele powi\u0105zanych rekord\xF3w jednego rekordu. W\u0119ze\u0142 p\u0119tli mo\u017Cna r\xF3wnie\u017C u\u017Cy\u0107 do iteracji okre\u015Blonej liczby razy lub do przegl\u0105dania ka\u017Cdego znaku w ci\u0105gu znak\xF3w. Jednak nadmierne p\u0119tlenie mo\u017Ce powodowa\u0107 problemy z wydajno\u015Bci\u0105, wi\u0119c u\u017Cywaj z ostro\u017Cno\u015Bci\u0105.",
